import './nav_bar.css';
import './Regi_Loshi_CV.pdf';
const NavBar = () => {
    return(
        <nav>
            <ul>
                <li className="Options">About me</li>
                <li className="Options">Projects</li>
                <li className="Options"> <a href="Regi_Loshi_CV.pdf Download">CV </a></li>
                <li  className="Contact"> <a href='mailto:regi@regiloshi.com'>Contact me </a></li>
            </ul>
        </nav>
    )
}
export default NavBar;
